import React, { useState } from 'react';
import EstudiantesService from '../../Services/EstudianteServices'; // Ajusta la ruta según tu estructura de carpetas
import { useNavigate } from 'react-router-dom';
import "./Login.css"

function EstudianteLoginForm() {
  const [correoElectronico, setCorreoElectronico] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();

    try {
      const estudianteId = await EstudiantesService.loginEstudiante(correoElectronico, password);

      // Autenticación exitosa, puedes realizar acciones adicionales si es necesario
      console.log('Inicio de sesión exitoso. ID del estudiante:', estudianteId);

      // Redirigir a la página después de iniciar sesión (ajusta la ruta según tu aplicación)
      navigate('/dashboard');
    } catch (error) {
      setError('Inicio de sesión fallido. Verifica tus credenciales.');
    }
  };

  return (
    <section className="vh-100">
      <div className="container py-5 h-100">
        <div className="row d-flex justify-content-center align-items-center h-100">
          <div className="col col-xl-10">
            <div className="card" style={{ borderRadius: '1rem' }}>
              <div className="row g-0">
                <div className="col-md-6 col-lg-5 d-none d-md-block">
                  <img
                    src="https://images.pexels.com/photos/4623357/pexels-photo-4623357.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
                    alt="login form"
                    className="img-fluid"
                    style={{ borderRadius: '1rem 0 0 1rem' }}
                  />
                </div>
                <div className="col-md-6 col-lg-7 d-flex align-items-center">
                  <div className="card-body p-4 p-lg-5 text-black">
                    <form onSubmit={handleLogin}>
                      <div className="d-flex align-items-center mb-3 pb-1">
                        <i className="fas fa-cubes fa-2x me-3 logo"></i>
                        <span className="h1 fw-bold mb-0">Inicio de sesion</span>
                      </div>
                      <h5 className="fw-normal mb-3 pb-3" style={{ letterSpacing: '1px' }}>
                        Iniciar sesión en su cuenta
                      </h5>
                      <div className="form-outline mb-4">
                        <input
                          type="email"
                          id="correoElectronico"
                          className="form-control form-control-lg"
                          value={correoElectronico}
                          onChange={(e) => setCorreoElectronico(e.target.value)}
                        />
                        <label className="form-label" htmlFor="correoElectronico">
                          Dirección de correo electrónico
                        </label>
                      </div>
                      <div className="form-outline mb-4">
                        <input
                          type="password"
                          id="password"
                          className="form-control form-control-lg"
                          value={password}
                          onChange={(e) => setPassword(e.target.value)}
                        />
                        <label className="form-label" htmlFor="password">
                          Contraseña
                        </label>
                      </div>
                      <div className="pt-1 mb-4">
                        <button className="btn btn-dark btn-lg btn-block btn-animated" type="submit">
                          Iniciar Sesión
                        </button>
                      </div>
                      <a className="small text-muted" href="#!">
                        ¿Olvidaste tu contraseña?
                      </a>
                      <p className="mb-5 pb-lg-2" style={{ color: '#393f81' }}>
                        ¿No tienes una cuenta?<a href="#!" style={{ color: '#393f81' }}>
                          Registrar aquí
                        </a>
                      </p>
                      <a href="#!" className="small text-muted">
                        Condiciones de uso.
                      </a>
                      <a href="#!" className="small text-muted">
                        Política de privacidad
                      </a>
                    </form>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default EstudianteLoginForm;
